import React, {useState} from 'react';
import './styles.css';
import axios from 'axios';

var getTeachers = async() => {
    var teachers;
    await axios.get("/get-teachers").then(response => teachers = response.data).catch(err => console.log(err))
    return teachers;

}

var ManagerTeachers = () => {
    return(
        <div>
            <h1>المعلمين</h1>
            <p>حيث يمكنك الاطلاع على المعلمين, اضافة معلمين او تعديل معلوماتهم</p>
            <button className="btn btn-success">إضافة معلم <img src="https://img.icons8.com/ios/20/ffffff/plus--v2.png"/></button>
        </div>
    );
}

export default ManagerTeachers;
